Ingredientes: 
1/2 taza de almendras remojadas toda la noche y peladas, 6 tazas de agua, 6 dátiles, 1/8 cucharadita de sal. 

.
.

Procedimiento: 
1. Después de que estén remojadas las almendras toda la noche, se duplicará el volumen así que se debe licuar con 1 taza de agua. 
2. Luego agregar los 6 dátiles con la sal.
3. Licúe perfectamente hasta que todo quede mezclado.
4. Guarde en un frasco de vidrio.
5. ¡Enjoy! 🥰 
